description:
Betsy Mahorn is an Hollywood actress who finally lands a role in an interesting movie. But a car accident forces her to stay in Creeper Creek, a small town in the Rockies. Her arrival coincides with horrific murders and makes her an ideal suspect for the police. Meanwhile, the children are getting ready for the macabre holiday of Halloween.
